import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Check if cart has items by examining cart text content
    const cartText = await page.$eval('.cart', el => el.textContent.trim());
    const cartCount = parseInt(cartText);

    if (cartCount === 0) {
      // Add an item to cart first if empty
      await page.waitForSelector('.add-to-cart', { timeout: 5000 });
      await page.click('.add-to-cart');

      // Wait for cart to update
      await page.waitForFunction(() => {
        const cartText = document.querySelector('.cart').textContent.trim();
        return parseInt(cartText) > 0;
      }, { timeout: 5000 });

      await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_added.png') });
      screenshots.push(path.join(screenshotsDir, 'step_2_item_added.png'));
    }

    // Open cart modal
    await page.click('.cart');
    await page.waitForSelector('#cartModal', { state: 'visible', timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_open.png'));

    // Remove item from cart
    await page.waitForSelector('.remove-item', { timeout: 5000 });
    await page.click('.remove-item');

    // Wait for cart to update
    await page.waitForFunction(() => {
      const cartText = document.querySelector('.cart').textContent.trim();
      return parseInt(cartText) === 0;
    }, { timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_item_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_item_removed.png'));

    // Verify removal by checking cart count
    const finalCartText = await page.$eval('.cart', el => el.textContent.trim());
    const finalCartCount = parseInt(finalCartText);

    return {
      success: true,
      action: "Successfully removed item from cart",
      extractedData: {
        initialCartCount: cartCount,
        finalCartCount: finalCartCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to remove item from cart",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
